import React, { Component, Fragment } from 'react';
import { Provider } from 'react-redux';
import { BrowserRouter, Route } from 'react-router-dom';
import { TicTacToe } from './pages/TicTacToe';
import { GoodsShow } from './pages/GoodsShow';
import { createStore, applyMiddleware } from 'redux'; 

const store = createStore(() => [], {}, applyMiddleware());

class Style extends React.Component {
    tictactoeClick() {
        <Route path='/TicTacToe' exact component={TicTacToe}></Route>
    }
    goodsshowClick() {
        <Route path='/GoodsShow' exact component={GoodsShow}></Route>
    }
    render() {
        return (
            <div>
                <button onClick={() => this.tictactoeClick()}>TicTacToe</button>
                <button onClick={() => this.goodsshowClick()}>GoodsShow</button>
            </div>
        );
    }
}

export class App extends Component {
    render() {
        return (
            <Provider store={store}>
                <Fragment>
                    <BrowserRouter>
                        <div>
                            <Style />
                            <Route path='/TicTacToe' exact component={TicTacToe}></Route>
                            <Route path='/GoodsShow' exact component={GoodsShow}></Route>
                        </div>
                    </BrowserRouter>
                </Fragment>
            </Provider>
        )
    }
}
